import React from 'react'

function TagsFilter(props) {
  const { tag, index } = props
  const ClickedTag = () => {
    console.log('filter has been clicked')
  }

  return (
    <>
      <span className="tagListItem" key={index} onClick={ClickedTag}>
        {tag}
      </span>
    </>
  )
}

export default TagsFilter
